Pauses the stopwatch. Any call to [`tick`](Stopwatch::tick) while
paused will not have any effect on the elapsed time.
# Examples
```
# use bevy_time::*;
use std::time::Duration;
let mut stopwatch = Stopwatch::new();
stopwatch.pause();
