Unpauses the stopwatch. Resume the effect of ticking on elapsed time.
# Examples
```
# use bevy_time::*;
use std::time::Duration;
let mut stopwatch = Stopwatch::new();
stopwatch.pause();
stopwatch.tick(Duration::from_secs_f32(1.0));
